import React, { useState } from 'react';
import { supabase } from '../supabaseClient'; // adjust the path if needed

function AddCSO({ students = [] }) {
  const [formData, setFormData] = useState({
    name: '',
    description: '',
    cluster: '',
    subscription: '',
    executives: []
  });

  const handleChange = (e) => {
    const { name, value, type } = e.target;
    setFormData({
      ...formData,
      [name]: type === "radio" ? value : value
    });
  };

  const handleExecutivesChange = (e) => {
    const selectedOptions = Array.from(e.target.selectedOptions, option => option.value);
    setFormData({ ...formData, executives: selectedOptions });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    console.log("Form submitted:", formData);

    // Insert CSO first
    const { data: csoData, error: csoError } = await supabase
      .from('cso')
      .insert([
        {
          name: formData.name,
          description: formData.description,
          subscription: formData.subscription,
          cluster: formData.cluster,
          // logo_url could be added later if you handle file uploads
        }
      ])
      .select()
      .single();

    if (csoError) {
      console.error("Error inserting CSO:", csoError);
      return;
    }

    console.log("CSO created:", csoData);

    // Link executives to CSO
    if (formData.executives.length > 0) {
      const executivesToLink = formData.executives.map(execId => ({
        cso_id: csoData.id,
        executive_id: execId,
        portfolio: "Chairperson", // default role for now
        can_post: true
      }));

      const { error: linkError } = await supabase
        .from('cso_executives')
        .insert(executivesToLink);

      if (linkError) {
        console.error("Error linking executives:", linkError);
      } else {
        console.log("Executives linked successfully");
      }
    }
  };

  return (
    <form onSubmit={handleSubmit} className="flex flex-col gap-3 p-4">
      <label>
        Logo
        <input type="file" name="logo" />
      </label><br />

      <label>
        CSO Name
        <input type="text" name="name" value={formData.name} onChange={handleChange} />
      </label><br />

      <label>
        Description
        <input type="text" name="description" value={formData.description} onChange={handleChange} />
      </label><br />

      <label>
        Cluster
        <select name="cluster" value={formData.cluster} onChange={handleChange}>
          <option value=""></option>
          <option value="political">Political Cluster</option>
          <option value="academic">Academic Cluster</option>
          <option value="social">Social Cluster</option>
          <option value="cultural">Cultural Cluster</option>
          <option value="religious">Religious Cluster</option>
          <option value="sport">WITS Sport</option>
          <option value="council">School Council</option>
        </select>
      </label><br />

      <label>
        Subscription
        <label>
          <input type="radio" name="subscription" value="no" onChange={handleChange} />
          No
        </label>
        <label>
          <input type="radio" name="subscription" value="yes" onChange={handleChange} />
          Yes
        </label>
      </label><br />

      <label>
        Executives
        <select
          multiple
          name="executives"
          value={formData.executives}
          onChange={handleExecutivesChange}
        >
          {students.map((student, index) => (
            <option key={index} value={student.id}>
              {student.name}
            </option>
          ))}
        </select>
      </label><br />

      <button type="submit">Add CSO</button>
    </form>
  );
}

export default AddCSO;
